import React from "react";
import Entity from "./Entity"
import emojipedia from "../emojipedia"


function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
      {/* <Entity id= {emojipedia[0].id} key={emojipedia[0].id} emoji={emojipedia[0].emoji} name={emojipedia[0].name} content={emojipedia[0].meaning}/> */}

      {emojipedia.map(function (it){
        <Entity id= {it.id} key={it.id} emoji={it.emoji} name={it.name} content={it.meaning}/>
      })}

      </dl>
    </div>
  );
}

export default App;
